function wav8ToFloat32Array(buffer){
  var view = new DataView(buffer, 44);
  var len = view.byteLength;
  var floats = new Float32Array(len);
  for (var i = 0; i < view.byteLength; i ++) {
    var s = view.getUint8(i, true);

    //s-=127;
    s /= 328;
    floats[i] = s; 
  }
  return floats;
}    
  
